jQuery(document).ready(function(t){tinymce.create("tinymce.plugins._svbk_helper_buttons",{init:function(t,e){t.addCommand("insert_section_template",function(){var t='<section class="content-section"> <header>   <h2>Title</h2>   <p class="subtitle">Subtitle</p> </header> <p>'+(tinyMCE.activeEditor.selection.getContent()||"Content")+"</p></section><br/>";tinymce.execCommand("mceInsertContent",!1,t)}),t.addCommand("insert_split_section_template",function(){var t='<section class="split-section">  <div class="first-part"></div>  <div class="second-part">    <header>      <p class="pretitle">Pretitle</p>      <h2>Title</h2>      <p class="subtitle">Subtitle</p>    </header>    <p>'+(tinyMCE.activeEditor.selection.getContent()||"Content")+"</p>  </div></section>";tinymce.execCommand("mceInsertContent",!1,t)}),t.addButton("section_button",{title:"Section",cmd:"insert_section_template",image:e.replace("js","icons")+"/tinymce/section.png"}),t.addButton("split_section_button",{title:"Split Section",cmd:"insert_split_section_template",image:e.replace("js","icons")+"/tinymce/split-section.png"})}}),tinymce.PluginManager.add("_svbk_helper_buttons",tinymce.plugins._svbk_helper_buttons)});